import React from 'react';
import './Contact.css';

const Contact = () => {
	return (
		<div className="contactPage">			
			<h1 id="contactHeader">contact:</h1>
			<ul id="contactList">
				<li>email</li>
				<li>bandcamp</li>
				<li>facebook</li>
			</ul>
  		</div>
	);
}

export default Contact;
